import { Routes, Route, Navigate } from "react-router-dom";
import "../styles/App.css";
import {routes} from "../router"

const AppRouter = () => {
  return (
    <Routes>
      {routes.map(route => 
        <Route 
          element={<route.element />} 
          path={route.path} 

        />
      )}
      <Route path="/*" element={<Navigate to="/posts" replace />} />
    </Routes>
  )
}

export default AppRouter
